import React, { useEffect, useState } from 'react'
import './index.css';

function Dado() {

    const [ dado, setDado ] = useState({});

    useEffect(() => {
        setDado(props.dado)
    }, [] )

    return (<>
        <div className="card dado mt-5 w-25">
            <div className="card-body center">
                <span>{dado.getNumero()}</span>
            </div>
        </div>
    </>)
}

export default Dado;
